import { Route } from "react-router-dom";
import Welcome from "./Page/Welcome";
import Products from './Page/Products';

function App() {
  return (
<div>
<Route path="/welcome">
  <Welcome/>
</Route>
<Route path="/products">
  <Products/>
</Route>
</div>
  );
}

export default App;
